        enterCallback: function () {
          gSampleFilters = [];
          self.filtersChanged();
        }
      });
      if (currentBreadcrumb == null || currentBreadcrumb.length == 0) {
        gTreeManager.restoreSerializedSelectionSnapshot(gRestoreSelection);
